//************************* 2020-11-26 전기분재무상태표 시작 최지은&노원찬 *************************
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles(theme => ({
  box: {
    background: "black",
    color: "white",
    width: "30%",
    height: "30px",
    textAlign: "center",
    fontSize: 20,
  },
  subCategory: {
    background: "#232f3e",
    color: "white",
    height: "50px",
  },
  Paper: {
    padding: theme.spacing(2),
    height: 850,
  },
}));

export default useStyles;
